struct Solution;

use std::collections::HashSet;

impl Solution {
    pub fn length_of_longest_substring(s: String) -> i32 {
        if s.is_empty() {
            return 0;
        }

        let s: Vec<char> = s.chars().collect();
        let mut max_length = 1;
        for i in 0..s.len() {
            let mut hs = HashSet::new();
            hs.insert(s[i]);
            for j in i + 1..s.len() {
                if hs.contains(&s[j]) {
                    break;
                }
                hs.insert(s[j]);
                max_length = max_length.max(j as i32 - i as i32 + 1);
            }
        }

        max_length
    }
}

